import React from "react";
import { Link } from "react-router-dom";

function NavBar() {
  return (
    <nav className="navbar navbar-light bg-light">
      <div className="container-fluid">
        <Link to="/">
          <a className="navbar-brand">Home / Path</a>
        </Link>
				/
				<p>Path</p>
      </div>
    </nav>
  );
}

export default NavBar;
